SELECT COUNT(DISTINCT a.cus_id) AS unique_customers
FROM accounts a
JOIN cards c ON a.cus_id = c.cus_id;

SELECT AVG(acc.acc_bal) as average_account_balance 
FROM accounts acc
INNER JOIN loans ln ON acc.cus_id = ln.cus_id;

SELECT COUNT(*) FROM (
    SELECT brc, COUNT(*) as customer_count
    FROM customers
    GROUP BY brc
    HAVING COUNT(*) > 500
) as branch_customer_counts;

SELECT COUNT(DISTINCT first.cus_id) AS count
FROM (
    SELECT cus_id, ln_type_id, ROW_NUMBER() OVER (PARTITION BY cus_id ORDER BY ln_st_dt) AS rn
    FROM loans
) AS first
INNER JOIN (
    SELECT cus_id, ln_type_id, ROW_NUMBER() OVER (PARTITION BY cus_id ORDER BY ln_st_dt) AS rn
    FROM loans
) AS second ON first.cus_id = second.cus_id AND first.rn = 1 AND second.rn = 2
WHERE first.ln_type_id <> second.ln_type_id;

SELECT COUNT(DISTINCT cu.id) AS customer_count
FROM customers cu
JOIN accounts a ON cu.id = a.cus_id
WHERE NOT EXISTS (
    SELECT 1 FROM accounts acc
    WHERE acc.cus_id = cu.id AND NOT EXISTS (
        SELECT 1 FROM loans l
        WHERE l.cus_id = acc.cus_id
    )
);

SELECT COUNT(DISTINCT acc_id) AS num_accounts_with_recent_transactions
FROM transactions
WHERE tran_dt >= NOW() - INTERVAL '60 days';

SELECT COUNT(DISTINCT l.cus_id) AS customer_count
FROM loans l
JOIN cards c ON l.cus_id = c.cus_id;

SELECT COUNT(*) AS count_above_average
FROM deposits
WHERE bal > (SELECT AVG(bal) FROM deposits);
